import { Label } from 'semantic-ui-react';

class ViewOrder extends Component {

    render() {
      let saladOrder = Object.values(this.props.order);
      return (
    <div className="container">
        <div>
          <h4 id="r2">{"Beställningar: "}</h4>
        </div>
        <div className="list-group">
         <ol id="orders">
             {saladOrder.map( item=> <Label value={item} value/>

             )} 
        </ol>
        </div>  
        <div>
        <button type='button' className='btn btn-primary'> Skicka beställning</button>
        </div>
    </div>
      )
    }
}

export default ViewOrder;
